import React from 'react';
import Form from 'react-bootstrap/Form'


const DamageDefectForm = () => {
    const damageDefectFormStyle = {
        alignSelf: <center></center>
    }
    return (
        <div>
            <h1>Damage/Defect Form</h1>
            <Form>
                <Form.File></Form.File>
            </Form>
        </div>
    )
}

export default DamageDefectForm;
